import React from 'react';
import Tilt from 'react-parallax-tilt';

const Logo = () =>{
    return (
        <div className='ma4 mt0'>
            <Tilt 
            className="background-stripes parallax-effect-glare-scale"
            perspective={500}
            glareEnable={true}
            glareMaxOpacity={0.45}
            scale={1.02}>
                <div>
                <h1>React Parallax Tilt ðŸ‘€</h1>
                </div>
            </Tilt>
        </div>
    )
}
export default Logo;
